# usage .\AcrobatReader.ps1 - installs Adobe Acrobat Reader 11.0.04


# Checks architecture to set variables
$query = Get-WmiObject -Class Win32_Processor | Select-Object AddressWidth 
If($query.AddressWidth -eq 32) {
$ProgFiles = 'Program Files'
$Keyvalue = 'HKEY_LOCAL_MACHINE\Software'}

If($query.AddressWidth -eq 64) {
$ProgFiles = 'Program Files (x86)'
$Keyvalue = 'HKEY_LOCAL_MACHINE\Software\Wow6432Node'}


# poplulating more variables
$Payload = ''
$mst = 'AcroRead.mst'
$programs = 'Acrobat'
$URL = 'http://ardownload.adobe.com/pub/adobe/reader/win/11.x/11.0.04/en_US/AdbeRdr11004_en_US.exe'
$target = 'c:\temp\Payload'
$exe = 'AdbeRdr11004_en_US.exe'
$file = 'AcroRead.msi'
$switches = "/q ALLUSERS=1 COMPANYNAME=""Time Warner Cable"" TRANSFORMS=$target\$mst"
$appfolder = "C:\$ProgFiles\Adobe"
$locations = 'c:\Users\Public\Desktop','C:\ProgramData\Microsoft\Windows\Start Menu'  
$applnk = "Adobe Reader*.lnk"


# create folder on target
New-Item -Path "$target" -type directory -Force


# reassemble string to binary
function Convert-StringToBinary {
     [CmdletBinding()]
     param (
           [string] $InputString
         , [string] $FilePath = ('{0}\{1}' -f $env:TEMP, [System.Guid]::NewGuid().ToString())
     )
 
    try {
         if ($InputString.Length -ge 1) {
             $ByteArray = [System.Convert]::FromBase64String($InputString);
             [System.IO.File]::WriteAllBytes($FilePath, $ByteArray);
         }
     }
     catch {
         throw ('Failed to create file from Base64 string: {0}' -f $FilePath);
     }
 
    Write-Output -InputObject (Get-Item -Path $FilePath);
 }


# reassemble binary to file 
$TargetFile = Convert-StringToBinary -InputString $Payload -FilePath $target\$mst;


# download file from HTTP
$wc = New-Object System.Net.WebClient
$wc.DownloadFile($URL, "$target\$exe")


# ends task on application
Stop-Process -processname "wusa" -Force
Stop-Process -processname "msiexec" -Force
Stop-Process -processname "AcroRd32" -Force
Stop-Process -processname "AdbeRdr*" -Force


# uninstalls previous versions
ForEach ($remove in $programs){
If ($remove) { 
Get-WmiObject -Class Win32_Product -Filter "Name LIKE '%$remove%'" | Foreach-Object {
Write-Host "Uninstalling: $($_.Name)"
$rv = $_.Uninstall().ReturnValue 
if($rv -eq 0) {"$($_.Name) uninstalled successfully"}
}
}
} 


# removes files and folders
Remove-Item "$appfolder\Reader*" -Recurse -Force
Foreach ($location in $locations) {Remove-Item "$location\$applnk" -Force}


# extracts files
$newProc=([WMICLASS]"root\cimv2:win32_Process").create("""$target\$exe"" -sfx_o""c:\AcrobatReader"" -sfx_ne")
While(Get-WmiObject Win32_Process -filter "ProcessID='$($newProc.ProcessID)'"){start-sleep -seconds 5}


# to install application
$newProc=([WMICLASS]"root\cimv2:win32_Process").create("C:\Windows\System32\msiexec.exe /i ""c:\AcrobatReader\$file"" $switches")
While(Get-WmiObject Win32_Process -filter "ProcessID='$($newProc.ProcessID)'"){start-sleep -seconds 5}


# uninstalls Acrobat.com
$app = Get-WmiObject -Class Win32_Product | Where-Object ($_.Name -match "Acrobat.com")
$app.Uninstall()


# sets permissions on application's directory and files
$newProc=([WMICLASS]"root\cimv2:win32_Process").create("c:\windows\system32\cacls.exe ""$appfolder"" /t /e /p Users:C") #set ACLs
While(Get-WmiObject Win32_Process -filter "ProcessID='$($newProc.ProcessID)'"){start-sleep -seconds 15}


# cleans up installation files
Remove-Item -Path "$target" -Recurse -Force
Remove-Item -Path "c:\AcrobatReader" -Recurse -Force